The debugger no longer single steps when a NullPointerException is hit, but rather continues along to the next breakpoint or program exit.

Here is a class Test that reproduces this problem using Eclipse 3.1 and 3.2, as well as JDK 1.4 and 1.5. Run it in the debugger and single step through the code. The first Exception (ArithmeticException) is caught normally and the debugger steps into the catch clause. The second Exception (NullPointerException) is also caught (verified by the println()), but the debugger does not step into the catch clause, but rather continues to program exit. The code executes correctly, but the debugger does not single step correctly after the NullPointerException.

public class Test
{
    public static void main(String[] args)
    {
        try
        {
            int i = 1/0;
        }
        catch (Exception e)
        {
            System.out.println("Single step stops here.");
        }

        try
        {
            String s = null;
            s.length();
        }
        catch (Exception e)
        {
            System.out.println("Single step doesn't stop here.");
        }

        System.out.println("Single step doesn't stop here either.");
    }
}

