We have a report with a cascading report parameter group   The group has three parameters that a displayed with combo boxes.  When using IE, if the user chooses an item in the first combo box and then generates the report without selecting an  value for the 2nd or 3rd parameter a javascript error occurs.

The error was caused by the following line in the collect_parameter : function( )

var temp = oSEC[0].options[oSEC[0].selectedIndex].text;	

The problem is caused by oSEC[0].selectedIndex having a value of -1 which is an invalid index.  On Firefox, this selectedIndex value is zero when an item is not selected.  

As a temporary fix, we have added the following code to insure the index is zero instead of -1.

if (oSEC[0].selectedIndex == -1) {
    oSEC[0].selectedIndex = 0;
}

Eclipse build id or SWT version: M20060629-1905

Platform(s) tested on: win32

Snippet title: place arbitrary control in a tree (similar to Snippet126)

Snippet code: 
package org.eclipse.swt.snippets;

import org.eclipse.swt.SWT;
import org.eclipse.swt.custom.CCombo;
import org.eclipse.swt.custom.TreeEditor;
import org.eclipse.swt.layout.FillLayout;
import org.eclipse.swt.widgets.Button;
import org.eclipse.swt.widgets.Control;
import org.eclipse.swt.widgets.Display;
import org.eclipse.swt.widgets.Shell;
import org.eclipse.swt.widgets.Text;
import org.eclipse.swt.widgets.Tree;
import org.eclipse.swt.widgets.TreeColumn;
import org.eclipse.swt.widgets.TreeItem;

public class MyTreeControlSnippet
{
    public static void main( String [] args )
    {
        Display display = new Display();
        final Shell shell = new Shell( display );
        shell.setLayout( new FillLayout() );
        Tree tree = new Tree( shell, SWT.BORDER | SWT.SINGLE );
        tree.setHeaderVisible( true );
        tree.setLinesVisible( true );

        TreeColumn column1 = new TreeColumn( tree, SWT.LEFT );
        column1.setText( "Property" );
        column1.setWidth( 300 );
        TreeColumn column2 = new TreeColumn( tree, SWT.LEFT );
        column2.setText( "Value" );
        column2.setWidth( 300 );

        TreeItem group1 = new TreeItem( tree, SWT.NONE );
        group1.setText( 0, "Group 1" );
        for ( int i = 0; i < 4; i++ )
        {
            TreeItem subItem = new TreeItem( group1, SWT.NONE );
            subItem.setText( 0, "Propery " + i );

            Control control = new Text( tree, SWT.SINGLE );
            TreeEditor editor = new TreeEditor( tree );
            editor.grabHorizontal = true;
            editor.setEditor( control, subItem, 1 );
        }

        TreeItem group2 = new TreeItem( tree, SWT.NONE );
        group2.setText( 0, "Group 2" );
        for ( int i = 0; i < 4; i++ )
        {
            TreeItem subItem = new TreeItem( group2, SWT.NONE );
            subItem.setText( 0, "Propery " + i );

            Control control = new CCombo( tree, SWT.FLAT );
            TreeEditor editor = new TreeEditor( tree );
            editor.grabHorizontal = true;
            editor.setEditor( control, subItem, 1 );
        }

        TreeItem group3 = new TreeItem( tree, SWT.NONE );
        group3.setText( 0, "Group 3" );
        for ( int i = 0; i < 4; i++ )
        {
            TreeItem subItem = new TreeItem( group3, SWT.NONE );
            subItem.setText( 0, "Propery " + i );

            Control control = new Button( tree, SWT.CHECK );
            control.pack();
            TreeEditor editor = new TreeEditor( tree );
            editor.horizontalAlignment = SWT.CENTER;
            editor.minimumWidth = control.getSize().x;
            editor.setEditor( control, subItem, 1 );
        }

        shell.pack();
        shell.open();
        while ( !shell.isDisposed() )
        {
            if ( !display.readAndDispatch() )
            {
                display.sleep();
            }
        }
        display.dispose();
    }

}

